<p>O Cadastro de Pessoas Físicas conhecido como CPF é o registro mantido pela Receita Federal do Brasil no qual podem se inscrever, uma única vez, quaisquer pessoas naturais, independentemente de idade ou nacionalidade, inclusive falecidas. Cada inscrito é unicamente identificado por um número de inscrição no CPF de 11 dígitos decimais. Esse número jamais muda senão por decisão judicial ou administrativa.</p>

<p>Para a formação dos dígitos é feito um calculo que pode ser encontrado no wikipedia.</p>

<p>O CPF poderá assumir as seguintes situações cadastrais:</p>

<ul>
    <li>Regular, quando não houver inconsistência cadastral e não constar omissão de DIRPF;</li>
    <li>Pendente de regularização, quando houver omissão de DIRPF;</li>
    <li>Suspensa, quando houver inconsistência cadastral;</li>
    <li>Cancelada por multiplicidade, quando houver mais de uma inscrição no CPF para a ");
            WriteLiteral(@"mesma pessoa;</li>
    <li>Cancelada por óbito sem espólio;</li>
    <li>Cancelada por encerramento de espólio; ou</li>
    <li>Nula, nos casos em que for constatada fraude.</li>

</ul>

<p>O cancelamento da inscrição no CPF ocorre a pedido ou de ofício. A simples falta de entrega de DIRPF não enseja o cancelamento do CPF.</p>

<p>Fonte: Wikipedia</p>

